import logo from "../assets/exam.png"
export default ({loggedIn, accountName, userID}) => (
    <div className="main">
        <img className="logo" src={logo} alt="logo" />
            <div className="logo" />
            {
                loggedIn ? <a className="account" href={`localhost:3000/user/${userID}`}>{accountName}</a> : <div className="account">
                    <a href="localhost:3000/login">Login</a><a href="localhost:3000/signup">Sign up</a>
                </div>
            }

    <style jsx>{`
        .main {
            display: flex;
            flex-direction: column;
            justify-content: center;
            height: 3rem;
            background: #2C404D;
        }

        .account {
            align-self: flex-end;
            display: flex;
            width: 20%;
            justify-content: space-around;
        }

        .logo {
            width:64px;
            height: 64px
        }

    `}</style>
    </div>
)
